import react,{useState} from 'react'
import Emojidata from './Emojidata'
let carrierObj={
border:"3px solid rgba(238, 28, 28, 0.897)",
height:"449px",
width:"500px",
display:"flex",
justifyContent:"space-evenly"
}
let boxObj={
    height:"445px",
    width:"95px",
    overflow:"hidden",
    backgroundColor:"rgb(240, 105, 105)"
}
const Emgcarrier=()=>{
    return(
        <>
     {
        Emojidata.map((val)=>{
          return(
              <>
              <span style={{fontSize:"40px",paddingLeft:"21px"}}>{val}</span>
              </>
          )
        })
        } 
    </>
    )
}
const Gameplay=(props)=>{
 if(props.gameStart==true)
 {
   setInterval(()=>{
  var endY= setInterval(()=>{
   document.getElementsByClassName('d1').scrollBy(0,1)
   if(document.getElementsByClassName('d1').scrollTop>=1696)
   {
     clearInterval(endY);
     var endY1=setInterval(()=>{
      document.getElementsByClassName('d1').scrollBy(0,-1) 
      if(document.getElementsByClassName('d1').scrollTop==0)
      clearInterval(endY);
     },10)
     }
   },10)
   },12)
 }
return(
<>
<div id="carrier" style={carrierObj}>
<div className="d1" style={boxObj}>
<Emgcarrier />
</div>
<div className="d1" style={boxObj}>
<Emgcarrier />
</div>
<div className="d1" style={boxObj}>
<Emgcarrier />
</div>
</div>
</>
)
}
export default Gameplay
